Event.create(:id => 2, :name => "Gadget Abend Köln", :description => "Der Gadget-Abend ist ein fröhliches Beisammensein interessierter Technik-Geeks, Web 2.0-Nerds und sonstigen Early Adoptern, die sich über neue Gadgets, Applikationen, Web 2.0, zukünftige Möglichkeiten und Chancen austauschen möchten. In ganz entspannter Atmosphäre, bei einem (oder zwei) Feierabendbierchen und kleinen Snacks. Keine trockenen Vorträge. Keine Anzüge. Keine Rollen. Dafür wahres Interesse, nette Gespräche und ehrliche Meinungen.\r\n\r\nDer \"Gadget-Abend Köln\" findet etwa alle 2-3 Monate in wechselnden Locations in Köln statt.", :schedule_yaml => "---\n:start_date: 2011-08-07 19:00:00.000000000 Z\n:duration: 10800\n:rrules: []\n:exrules: []\n:rtimes:\n- 2011-08-08 19:00:00.000000000 +02:00\n- 2011-11-15 19:00:00.000000000 +01:00\n- 2012-02-06 19:00:00.000000000 +01:00\n:extimes: []\n", :url => "http://gadget-abend.mixxt.com/", :full_day => false, :category_id => 10)
