Event.create(:id => 4, :name => "pyCologne", :description => "pyCologne ist eine Gruppe von Python-Interessenten aus der Region Köln-Bonn-Düsseldorf und zum Teil auch darüber hinaus. Sie setzt sich zusammen aus Studenten, Berufstätigen sowie ehemalig Berufstätige, Anfängern, Profis und solche, die es werden wollen. Die Teilnehmer kommen aus unterschiedlichen Tätigkeitsbereichen, sind bei privaten Firmen, öffentlichen Gesellschaften und Forschungseinrichtungen beschäftigt, sowie teils auch selbstständig.\r\n \r\nIn den monatlichen Treffen werden Neuigkeiten aus der Python-Welt vorgestellt und und diskutiert. Durch Vorträge der Mitglieder und externer Referenten werden die vielfältigen Möglichkeiten der Sprache aufgezeigt und es wird vorgestellt, wie Python eingesetzt wird und was mit Python bereits erreicht wurde.", :schedule_yaml => "---\n:start_date: 2011-08-07 19:00:00.000000000 Z\n:duration: 10800\n:rrules:\n- :validations:\n    :day_of_week:\n      3:\n      - 2\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes:\n- 2011-08-10 18:30:00.000000000 +02:00\n:extimes: []\n", :url => "http://wiki.python-forum.de/pycologne/", :twitter => "pycologne", :full_day => false, :category_id => 3, :venue_id => 76, :picture_id => 34)
Event.create(:id => 5, :name => "Bonn Agile Meetup", :description => "A place to meet for people interested in all things agile.\r\n\r\nThe meetup is loosely organized by a fluxing bunch of volunteers, independent of any company. \r\n\r\nTopics are: Agile Software Development practices, principles and values. We touch on XP, Scrum, Kanban, Katas, Dojos, Testing, TDD, Pair-programming, Continuous Integration, User Stories, and many other related topics.", :schedule_yaml => "---\n:start_date: 2011-08-07 19:00:00.000000000 Z\n:duration: 7200\n:rrules:\n- :validations:\n    :day_of_week:\n      2:\n      - 1\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes:\n- 2012-02-27 19:00:00.000000000 +01:00\n:extimes: []\n", :url => "http://sites.google.com/site/bonnagile/", :twitter => "bonnagile", :full_day => false, :category_id => 3, :picture_id => 37)
Event.create(:id => 6, :name => "Cologne Clojure User Group", :description => "Die Cologne Clojure User Group and Functional Programming Group trifft sich jeden 3. Donnerstag im Monat und beschäftigt sich mit Clojure und anderen Themen / Programmiersprachen der Funktionalen Programmierung.\r\n\r\nJeder ist herzlich dazu eingeladen, an den Treffen der Cologne Clojure User Group and Functional Programming Group teilzunehmen und diese mitzugestalten. Da wir auch eine Functional Programming Group für den Raum Köln sind, werden auch Vorträge über andere funktionale Programmiersprachen als Clojure gerne gesehen.\r\n\r\nBei jedem Treffen gibt es einen größeren Talk (ca. 30 Minuten), danach ist der Abend frei gestaltbar mit z. B. Hacking, fünfminütigen Lighting Talks, Diskussionen, Coding Dojos ...\r\n\r\nAuch Clojure-Interessierte sind herzlich willkommen und werden im frei gestaltbaren Teil des Abends von den anderen User Group Mitgliedern mit nützlichen Tipps und Erklärungen zu Clojure versorgt.", :schedule_yaml => "---\n:start_date: 2011-08-07 19:00:00.000000000 Z\n:duration: 7200\n:rrules:\n- :validations:\n    :day_of_week:\n      4:\n      - 3\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes:\n- 2012-01-12 19:00:00.000000000 +01:00\n- 2012-02-23 19:00:00.000000000 +01:00\n:extimes:\n- 2012-01-19 19:00:00.000000000 +01:00\n- 2012-02-16 19:00:00.000000000 +01:00\n- 2012-05-17 19:00:00.000000000 +02:00\n", :url => "http://www.meetup.com/clojure-cologne/", :twitter => "clojurecologne", :full_day => false, :category_id => 3, :venue_id => 192, :picture_id => 36)
Event.create(:id => 7, :name => "Android User Group Bonn", :description => "In der Android User Group Bonn - kurz AUG Bonn - treffen sich Benutzer, Entwickler und Interessierte zum Thema Android in Bonn. Umliegende Städte und Besucher sind natürlich auch eingeladen spontan vorbeizuschauen. \r\n\r\nWir versuchen uns regelmäßig zu treffen um Erfahrungen und Ideen austauschen.", :schedule_yaml => "---\n:start_date: 2011-08-07 12:36:00.000000000 +02:00\n:duration: 7200\n:rrules: []\n:exrules: []\n:rdates:\n- 2011-09-08 20:00:00.000000000 +02:00\n- 2011-09-15 20:00:00.000000000 +02:00\n- 2011-09-19 19:00:00.000000000 +02:00\n- 2011-11-03 18:30:00.000000000 +01:00\n- 2012-04-10 17:30:00.000000000 +02:00\n:exdates: []\n", :url => "https://www.xing.com/net/priaee456x/augbonn", :full_day => false, :category_id => 3, :venue_id => 3)
