Event.create(:id => 10, :name => "Froscon", :description => "Free Software and Open Source – these are the topics of FrOSCon (Free and Open Source Software Conference). The computer science department of the University of Applied Sciences Bonn-Rhein-Sieg, supported by LUUSA and FrOSCon e.V. are yearly presenting an exciting programm with talks, workshops and an exhibition the third weekend in August. The social event, that takes place saturday night gives you the opportunity to exchange opinions with other visitors, speakers or volunteers. 2011 the sixth conference will take place on August, 20st and 21nd.", :schedule_yaml => "---\n:start_date: 2011-08-07 12:54:00.000000000 +02:00\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes:\n- 2011-08-20 08:15:00.000000000 +02:00\n- 2011-08-21 09:00:00.000000000 +02:00\n:extimes: []\n", :url => "http://froscon.org/", :twitter => "FrOSCon", :full_day => true, :category_id => 3, :venue_id => 5)
