Event.create(:id => 12, :name => "Cocoaheads Aachen", :description => "CocoaHeads.org is an international group devoted to discussion of Apple's Cocoa Framework for programming on MacOS X. During monthly meetings, members present on their projects and offer tutorials on various programming topics.\r\n\r\nWe are the CocoaHeads Aachen Chapter, hosted by the Media Computing and Human-Computer Interaction Group at RWTH Aachen University and supported by Apple. We get together for informal short talks and demos, have a pizza, and talk code.", :schedule_yaml => "---\n:start_date: 2011-08-07 19:00:00.000000000 Z\n:duration: 7200\n:rrules:\n- :validations:\n    :day_of_week:\n      4:\n      - -1\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes: []\n:extimes:\n- 2012-05-31 19:00:00.000000000 +02:00\n- 2012-12-27 19:00:00.000000000 +01:00\n- 2013-05-30 19:00:00.000000000 +02:00\n", :url => "http://www.cocoaheads.de/", :full_day => false, :category_id => 3, :venue_id => 7, :venue_info => "Informatikzentrum , Raum 2222 (2. Etage)", :picture_id => 219)
Event.create(:id => 13, :name => "OpenChaos Köln", :description => "Das OpenChaos ist eine Bildungsveranstaltung mit der Option den C4 kennenzulernen. Es findet am letzten Donnerstag jedes Monats (außer Dezember, wegen Weihnachten und Chaos Communication Congress) ab 20:00h (Ab 19:30h ist auf jeden Fall schon die Tür offen) im Clubraum statt. Wann das genau ist und um welches Thema es geht steht auf unserer Homepage.", :schedule_yaml => "---\n:start_date: 2011-08-07 20:00:00.000000000 Z\n:duration: 10800\n:rrules:\n- :validations:\n    :day_of_week:\n      4:\n      - -1\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes:\n- 2012-04-21 19:00:00.000000000 +02:00\n:extimes:\n- 2011-12-29 20:00:00.000000000 +01:00\n- 2012-12-27 20:00:00.000000000 +01:00\n", :url => "https://wiki.koeln.ccc.de/index.php/OpenChaos", :full_day => false, :category_id => 3, :venue_id => 76, :picture_id => 35)
Event.create(:id => 14, :name => "Sportfreunde der Sperrtechnik", :description => "Der Zweck des Vereins ist die Pflege der Sperrtechnik als sportliche Herausforderung. Unter dem Begriff Sperrtechnik verstehen wir sämtliche Verfahren und Kenntnisse, welche mittels mechanischer und/oder elektronischer Maßnahmen (Schlösser, Schließsysteme und andere Sicherheitstechnologie) den Zugang beschränken. Des weiteren strebt der Verein einen Informationsaustausch an, dieser soll unter anderem mit unserem Wissens-Wiki verwirklicht werden.", :schedule_yaml => "---\n:start_date: 2011-08-07 19:00:00.000000000 Z\n:duration: 7200\n:rrules:\n- :validations:\n    :day_of_week:\n      3:\n      - -1\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes: []\n:extimes:\n- 2012-12-26 19:00:00.000000000 +01:00\n", :url => "http://wiki.ssdev.org/wiki/K%C3%B6ln", :full_day => false, :category_id => 10, :venue_id => 9)
Event.create(:id => 15, :name => "Luusa - Linux/Unix Usergroup St. Augustin", :description => "Wir sind eine Gruppe junger Menschen, die Interesse an jeglicher Form von Betriebssystemen haben. Unser Schwerpunkt liegt dabei auf freien Unix-Varianten wie GNU/Linux, NetBSD, FreeBSD oder OpenBSD. Wir beschäftigen uns aber auch beruflich und privat mit anderen Betriebssystemen wie MacOS X oder Solaris.\r\n\r\nZiel von LUUSA ist es, eine Plattform für betriebssystemübergreifende Diskussionen rund um Unix zu sein, Hilfestellungen und Anregungen für Einsteiger zu bieten sowie Projekten aus dem OpenSource-Umfeld Infrastruktur zur Verfügung zu stellen.", :schedule_yaml => "---\n:start_date: 2011-08-07 20:00:00.000000000 Z\n:duration: 7200\n:rrules:\n- :validations:\n    :day_of_week:\n      4:\n      - 1\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes: []\n:extimes:\n- 2013-01-03 20:00:00.000000000 +01:00\n", :url => "http://www.luusa.org/", :full_day => false, :category_id => 3, :venue_id => 10)
Event.create(:id => 16, :name => "Linux Workshop Köln", :description => "Der Linux-Workshop Köln (LiWoK) ist eine Gruppe von Linux-Anwendern in Köln, die sich jeden ersten Dienstag im Monat treffen. Gegenstand der Treffen sind kurze Vorträge und Erfahrungsberichte von Anwendern, Erfahrungsaustausch und Hilfestellung und Problemdiskussionen. Der gesellige Teil kommt nicht zu kurz.", :schedule_yaml => "---\n:start_date: 2011-08-07 19:00:00.000000000 Z\n:duration: 10800\n:rrules:\n- :validations:\n    :day_of_week:\n      2:\n      - 1\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes: []\n:extimes:\n- :time: 2013-01-01 18:00:00.000000000 Z\n  :zone: Berlin\n", :url => "http://www.uni-koeln.de/themen/linux/index.html", :full_day => false, :category_id => 3, :venue_id => 11, :picture_id => 31)
Event.create(:id => 17, :name => "NoSQL User Group Cologne", :description => "Wer hat Lust, sich über neue Datenbank-Technologien und aktuelle Entwicklungen in der NoSQL-Szene auszutauschen oder einfach nur gut zu unterhalten?\r\n\r\nWir haben die NoSQL-User-Group in Köln ins Leben gerufen. Du bist herzlich eingeladen! Die Teilnahme ist kostenfrei. Bitte melde Dich zur Raum-, Snack- & Getränkeplanung an.", :schedule_yaml => "---\n:start_date: 2011-08-07 19:00:00.000000000 Z\n:duration: 10800\n:rrules:\n- :validations:\n    :day_of_week:\n      3:\n      - 1\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes: []\n:extimes:\n- :time: 2012-10-03 17:00:00.000000000 Z\n  :zone: Berlin\n- :time: 2013-01-02 18:00:00.000000000 Z\n  :zone: Berlin\n- :time: 2013-05-01 17:00:00.000000000 Z\n  :zone: Berlin\n", :url => "http://www.nosql-cologne.org/", :twitter => "nosqlcgn", :full_day => false, :category_id => 3, :venue_id => 111, :picture_id => 25)
Event.create(:id => 18, :name => "Sofware Freedom Day", :description => "Am Tag der freien Software werden seit dem Jahr 2004 jedes Jahr die Erfolge freier Software gefeiert. Aus einer ersten Idee, umgesetzt von einer kleinen Gruppe von Enthusiasten, die die Dach­organisation Software Freedom International (SFI) gründeten, wurde ein weltweit begangener Tag. Freunde freier Software bilden Arbeits­gruppen und organisieren ehren­amtlich Veran­staltungen, um Leistungs­fähigkeit und Erfolge freier Software einer breiteren Öffent­lich­keit vorzustellen.\r\n\r\nIn Köln organisiert der Computer Club Pascal unter Mithilfe von Mitgliedern des Linux-Workshops Köln ein Vortrags­programm mit Gelegen­heiten zum Informations­austausch. Jeder Interessierte – egal ob neu, fort­geschritten und/oder Mitglied einer User-Gruppe oder nicht – ist eingeladen, zu kommen!", :schedule_yaml => "---\n:start_date: 2011-08-07 10:00:00.000000000 +02:00\n:duration: 25200\n:rrules: []\n:exrules: []\n:rtimes:\n- 2011-09-17 10:00:00.000000000 +02:00\n:extimes: []\n", :url => "http://sfd.koelnerlinuxtreffen.de/", :full_day => false, :category_id => 3, :venue_id => 82)
Event.create(:id => 19, :name => "Bonn-to-Code.net", :description => ".NET Usergroup für Bonn und Umgebung.\r\n\r\nBonn-to-Code.Net ist ein lockerer Zusammenschluss von Interessierten (Studenten, Angestellte, Selbstständige), die sich auf regelmäßigen Treffen zu Microsoft-Themen mit dem Schwerpunkt \".NET\" austauschen.\r\n\r\nEs wird Wert auf ein unkompliziertes Miteinander gelegt, deshalb gibt es keine formale Mitgliedschaft, die Teilnahme an Treffen ist kostenlos und eine explizite Anmeldung zu den Treffen ist auch nicht notwendig.\r\n\r\nAlles nach dem Motto \"Vorbeikommen, nette Leute treffen und Spaß haben\".", :schedule_yaml => "---\n:start_date: 2011-08-07 19:00:00.000000000 Z\n:duration: 10800\n:rrules: []\n:exrules: []\n:rtimes:\n- 2011-09-27 19:00:00.000000000 +02:00\n- 2011-10-25 19:00:00.000000000 +02:00\n- 2011-11-29 19:00:00.000000000 +01:00\n- 2012-01-24 19:00:00.000000000 +01:00\n- 2012-02-28 19:00:00.000000000 +01:00\n- 2012-03-30 19:00:00.000000000 +02:00\n- 2012-05-22 22:00:00.000000000 +02:00\n:extimes: []\n", :url => "http://www.bonn-to-code.net/", :full_day => false, :category_id => 3, :venue_id => 13, :picture_id => 119)
