Event.create(:id => 22, :name => "stARTcamp Köln", :description => "\"Social Web ist schön, macht aber viel Arbeit.\"\r\n\r\nDas stARTcamp Köln ist ein Mashup aus Konferenz und Barcamp und findet in Anlehnung an die stARTconference statt: [www.startconference.org](http://www.startconference.org)\r\n\r\nNeben dem Camp gibt es einmal im Jahr einen bunten Abend.", :schedule_yaml => "---\n:start_date: 2011-08-09 19:12:00.000000000 Z\n:duration: 28800\n:rrules: []\n:exrules: []\n:rtimes:\n- 2011-10-07 10:00:00.000000000 +02:00\n:extimes: []\n", :url => "http://startcamp-koeln.mixxt.de/", :twitter => "startcampk", :full_day => false, :category_id => 3, :venue_id => 16)
Event.create(:id => 23, :name => "SkillsCamp", :description => "Das SkillsCamp ist ein Open Space Format, die Teilnehmer entscheiden selbst was sie an dem Tag bearbeiten. Gegenüber einem komplett offenen Open Space wird bei einem SkillsCamp der Themenbereich etwas eingeschränkt. Dieses SkillsCamp dreht sich rund um ASP.NET und die dazugehörigen Methoden und Techniken. \r\n\r\nDiesmal geht es rund um\r\n\r\n* ASP.NET MVC\r\n* REST\r\n* API\r\n* HTML 5\r\n* jQuery\r\n* was machen andere Frameworks wie Fubu, Rails, usw.\r\n* und verwandte Bereiche", :schedule_yaml => "--- \n:start_date: 2011-08-09 19:15:00 +02:00\n:rrules: []\n\n:exrules: []\n\n:rdates: \n- 2011-08-26 19:00:00 +02:00\n- 2011-08-27 10:00:00 +02:00\n:exdates: []\n\n:duration: 7200\n:end_time: \n", :url => "http://skillscamp.de/", :twitter => "skillscamp", :full_day => false, :category_id => 3, :venue_id => 17)
