Event.create(:id => 25, :name => "DLR Tag der Luft und Raumfahrt", :description => "Das Deutsche Zentrum für Luft- und Raumfahrt (DLR) veranstaltet den \"Tag der Luft- und Raumfahrt\". An diesem Tag zeigen das DLR und die Europäische Weltraumorganisation ESA gemeinsam mit ihren Partnern in Köln-Porz exzellente Forschung aus Luft- und Raumfahrt, Energie und Verkehr. Hightech wird konkret erfahrbar und erlebbar für junge und alte Besucher.", :schedule_yaml => "---\n:start_date: 2011-08-11 17:43:00.000000000 Z\n:duration: 28800\n:rrules: []\n:exrules: []\n:rtimes:\n- 2011-09-18 10:00:00.000000000 +02:00\n:extimes: []\n", :url => "http://www.dlr.de/tdlr/", :twitter => "DLR_de", :full_day => false, :category_id => 3, :venue_id => 19)
