Event.create(:id => 27, :name => "ROBODONIEN", :description => "ROBODONIEN lädt Künstler aus ganz Europa ein, die den Kunst- und Kulturfreistaat Odonien in eine multimediale, interaktive Science-Fiction Szenerie verwandeln. Die Installationen, kinetischen Objekte und spektakulären Shows bieten den Besuchern eine Fülle von ungewöhnlichen und spannenden Impressionen.", :schedule_yaml => "---\n:start_date: 2011-08-13 15:32:00.000000000 +02:00\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes:\n- 2011-09-15 20:00:00.000000000 +02:00\n- 2011-09-16 20:00:00.000000000 +02:00\n- 2011-09-17 20:00:00.000000000 +02:00\n- 2011-09-18 20:00:00.000000000 +02:00\n:extimes: []\n", :url => "http://www.robodonien.de/", :full_day => true, :category_id => 3, :venue_id => 21)
Event.create(:id => 28, :name => "u23", :description => "U23 ist ein Projekt für junge Hacker und Haecksen bis 23 Jahre. An sieben Terminen werden die Teilnehmer gemeinsam mit den Tutoren in die Welt der Internetsecurity aufbrechen.\r\nIhr werdet lernen, wie Webseiten gesichert werden und natürlich auch wie diese Sicherheit umgangen werden kann.\r\n\r\nNicht nur für computeraffine Menschen ist das Thema \"(Un-)Sicherheit im Internet\" präsenter denn je, weshalb wir uns im diesjährigen u23 diesem Themenkomplex unter der Überschrift Webanwendungs- und Serversicherheit eingehender widmen.\r\n\r\nDer Chaos Computer Club Cologne veranstaltet das u23 im nahezu jährlichen Rhythmus seit 2002. In der Vergangenheit behandelten wir beispielsweise die Themen Hardwarebastelei, Softwareentwicklung oder Grundlagen der Netzwerktechnik.\r\n\r\nIm Rahmen der sieben Termine vom 19. September bis 31. Oktober 2011 beschäftigen sich die Teilnehmer eingehend mit verschiedenen Angriffs- und Absicherungstechniken im Bezug auf Webseiten. Unsere Tutoren helfen den Gruppen die erforderlichen Kenntnisse zu erlernen, vermitteln Wissen und geben Denkanstösse.\r\nDie Arbeit in den Gruppen wird durch die Eigeninitiative der Teilnehmer angetrieben und bietet darüber hinaus die Möglichkeit, außerhalb der Vortragstermine am gemeinsamen Projekt in den Clubräumen des Chaos Computer Club Cologne weiter zu arbeiten.\r\nAls Abschluss des Projektes wird ein gemeinsamer \"penetration test\" (pentest) einer realitätsnahen Umgebung durchgeführt.", :schedule_yaml => "--- \n:start_date: 2011-08-13 19:00:00 +02:00\n:rrules: []\n\n:exrules: []\n\n:rdates: \n- 2011-09-19 19:00:00 +02:00\n- 2011-09-26 19:00:00 +02:00\n- 2011-10-03 19:00:00 +02:00\n- 2011-10-10 19:00:00 +02:00\n- 2011-10-17 19:00:00 +02:00\n- 2011-10-24 19:00:00 +02:00\n- 2011-10-31 19:00:00 +01:00\n- 2011-09-08 19:00:00 +02:00\n:exdates: []\n\n:duration: 10800\n:end_time: \n", :url => "http://koeln.ccc.de/u23/", :full_day => false, :category_id => 3, :venue_id => 22)
Event.create(:id => 29, :name => "WordCamp", :description => "Der Begriff WordCamp setzt sich aus WordPress und Barcamp zusammen und ist als eine sogenannte Unkonferenz zu sehen, an der jede Organisation und jede Einzelperson teilnehmen kann, wenn sie ein Interesse am Bereich Web allgemein und WordPress im Speziellen hat. Es geht um das Zusammenfinden unterschiedlichster Menschen, vom Experten bis zum Laien, aus aller Welt, das Diskutieren neuer Ideen und bestehender Landschaften sowie das Entwickeln von Lösungen. Initiator ist die Community von WordPress Deutschland.", :schedule_yaml => "--- \n:start_date: 2011-08-13 15:44:23.166801 +02:00\n:rrules: []\n\n:exrules: []\n\n:rdates: \n- 2011-09-24 20:00:00 +02:00\n:exdates: []\n\n:duration: 3600\n:end_time: \n", :url => "http://wordcamp.de/", :twitter => "wordcamp_de", :full_day => true, :category_id => 3, :venue_id => 23)
Event.create(:id => 30, :name => "PLATINE", :description => "Die PLATINE ist ein Festival, welches sich im Spannungsfeld zwischen elektronischer Kunst und alternativen Spielformen bewegt und 2011 zum zweiten Mal stattfindet.\r\n\r\nEntwickler und Künstler aus ganz Deutschland – und sechs anderen Ländern – präsentieren auf dieser neu geschaffenen Plattform ihre Werke. Räumlich fokussiert sich die PLATINE auf Köln – Ehrenfeld und ist hier in klassischer Kneipenkultur, theatralen Wirkungsstätten wie auch innovativen Bürogemeinschaften zu Hause. So will die PLATINE für ihre Besucher nicht nur Inspiration, sondern Erlebnisse, Entdeckungen und Austausch im urbanen Raum schaffen.", :schedule_yaml => "--- \n:start_date: 2011-08-13 19:00:00 +02:00\n:rrules: []\n\n:exrules: []\n\n:rdates: \n- 2011-08-15 19:00:00 +02:00\n- 2011-08-16 19:00:00 +02:00\n- 2011-08-17 19:00:00 +02:00\n- 2011-08-18 19:00:00 +02:00\n- 2011-08-19 19:00:00 +02:00\n:exdates: []\n\n:duration: 10800\n:end_time: \n", :url => "http://www.platine-cologne.de/11/", :full_day => false, :category_id => 3)
