Event.create(:id => 37, :name => "netnocamp", :description => "Kreativ- und Zukuntswerkstatt Social Media Research\r\n\r\nIm vergangenen Jahr stand eine Diskussion qualitativ vs. quantitativ, vertreten durch die Ansätze Netnographie und Social Media Monitoring im Vordergrund. In diesem Jahr ist das Thema mit dem Untertitel Perspektiven der Social Media Research weiter gefasst. Im Anschluß an eine Keynote und weitere Plenarvorträge werden Sessions und Workshops zu einzelnen Themen stattfinden. Angemeldete Teilnehmer können weitere Themen vorschlagen, die dann an die Agenda eingebaut werden. Prof. Robert Kozinets aus Toronto, der Urheber des Ansatzes Netnography hat bereits seine – virtuelle – Teilnahme zugesagt und wird per Video zugeschaltet.", :schedule_yaml => "--- \n:start_date: 2011-08-21 07:46:46.519854 +02:00\n:rrules: []\n\n:exrules: []\n\n:rdates: \n- 2011-09-16 20:00:00 +02:00\n:exdates: []\n\n:duration: 3600\n:end_time: \n", :url => "http://www.netnocamp.de/", :full_day => true, :category_id => 3, :venue_id => 28)
