Event.create(:id => 45, :name => "CamelCaseCon 2011 - Die große deutsche Groovy Convention", :description => "Mit der \"Groovy Convention\" starten wir unsere Veranstaltungsreihe zu \"neuen\" Programmiersprachen.\r\n\r\nMit unserer Veranstaltungsreihe CamelCaseCon wollen wir einen Überblick auf neue Programmiersprachen und ihre Bedeutung in der Software-Entwicklung geben. Mit \"neuen Sprachen\" sind im wesentlichen Sprachen gemeint, die \"nach Java\" entstanden sind, wesentliche Veränderungen bringen und bereits erfolgreich in Projekten eingesetzt werden. Auf dieser Liste stehen Sprachen wie Scala, Ruby, , Clojure, Groovy, F# u.v.m. Auch wenn sie Sprachen wie Java und C# sicher nicht ablösen, so lassen sie sich vielfach einsetzen,  um Aufgaben wesentlich effektiver zu lösen.\r\n\r\nDaher lohnt sich für Entwickler oft die Beschäftigung mit einer oder mehrerer dieser Sprachen, auch wenn er/sie seiner oder ihrer \"ersten\" Sprache treu bleibt.", :schedule_yaml => "--- \n:start_date: 2011-08-31 16:15:21.393902 +02:00\n:rrules: []\n\n:exrules: []\n\n:rdates: \n- 2011-09-07 20:00:00 +02:00\n:exdates: []\n\n:duration: 3600\n:end_time: \n", :url => "http://www.camelcasecon.de/", :full_day => true, :category_id => 3, :venue_id => 32)
Event.create(:id => 46, :name => "Düsseldorf Gamers Group", :description => "This group has been started with the intention of creating a small community of people who enjoy playing games. This group is here to provide people with a way of going beyond the computer monitor and spending some time with the people they play with. If you are enthusiastic about playing video games, board games, role play games, card games, ANY kind of game, and you would like to meet other people who enjoy it too, you should join us! Feel free to make your own events and choose the size, do you want to make a mini lan party? would you like a friendly game of Wist on the weekend? Anything you can think of, make an event and invite other people to come and join you.", :schedule_yaml => "--- \n:start_date: 2011-09-06 07:54:00 +02:00\n:rrules: []\n\n:exrules: []\n\n:rdates: \n- 2011-09-10 19:30:00 +02:00\n- 2011-10-23 15:00:00 +02:00\n- 2011-12-17 18:00:00 +01:00\n:exdates: []\n\n:duration: 10800\n:end_time: \n", :url => "http://www.meetup.com/The-Dusseldorf-Gamers-Meetup-Group", :full_day => false, :category_id => 3, :venue_id => 33)
Event.create(:id => 47, :name => "Freiheit statt Angst-Demo Berlin", :description => "Ein breites gesellschaftliches Bündnis ruft zur Demonstration für Freiheitsrechte, für einen modernen Datenschutz und für ein freies Internet auf: Am Samstag, den 10. September 2011 wird unter dem Motto “Freiheit statt Angst” in Berlin und in anderen Städten weltweit ein internationaler Aktionstag für eine offene Gesellschaft und gegen den ausufernden Überwachungswahn stattfinden.", :schedule_yaml => "--- \n:start_date: 2011-09-06 17:53:36.568866 +02:00\n:rrules: []\n\n:exrules: []\n\n:rdates: \n- 2011-09-10 20:00:00 +02:00\n:exdates: []\n\n:duration: 3600\n:end_time: \n", :url => "http://freiheitstattangst.de", :full_day => true, :category_id => 3)
Event.create(:id => 48, :name => "Symphony Symposium", :description => "After the great success of the Symphony Symposium 2010 in London, we are happy to announce the second gathering of Symphony enthusiasts: The Symphony Developer Conference 2011 in Cologne, Germany. From beginners to experts, this three-day event from September 30 to October 2, 2011 invites all designers, coders and XSLT lovers working with Symphony to join the talks and discussions.", :schedule_yaml => "--- \n:start_date: 2011-09-07 21:46:46.070393 +02:00\n:rrules: []\n\n:exrules: []\n\n:rdates: \n- 2011-09-30 20:00:00 +02:00\n- 2011-10-01 20:00:00 +02:00\n- 2011-10-02 20:00:00 +02:00\n:exdates: []\n\n:duration: 3600\n:end_time: \n", :url => "http://symphony-cms.com/get-involved/events/symposium-2011/", :full_day => true, :category_id => 3)
Event.create(:id => 49, :name => "Webgrrls Symposium", :description => "Chancen, Potenziale, Risiken: Das Netz steckt voller Möglichkeiten, doch lauern auch Fallstricke. Social Media sind auch in diesem Jahr der PR-Trend schlechthin – nur für wen, wie und wann kommen Twitter & Co in Frage? Was gibt es Neues aus der SEO- und CMS-Welt, wie funktioniert virtuelle Teamarbeit? Wie macht man Texte fit fürs Web und ein Design barrierefrei? Themen rund um Neue Medien und Technologien stehen beim bundesdeutschen webgrrls-Symposium 2011 auf dem Programm. Freuen Sie sich auf spannende Expertinnen-Vorträge, reges Netzwerken und einen lebendigen Erfahrungsaustausch.", :schedule_yaml => "---\n:start_date: 2011-09-07 21:49:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes:\n- 2011-11-05 20:00:00.000000000 +01:00\n:extimes: []\n", :url => "http://www.webgrrls-nrw.de/webgrrls-symposium-2011/", :full_day => true, :category_id => 3, :venue_id => 34)
Event.create(:id => 50, :name => "XXXCCC: 30 Jahre Chaos Computer Club", :description => "\r\nIm September 1981 fand sich in Berlin eine Gruppe von Interessierten \"Komputerfrieks\" zusammen, die später zur Gründung des Chaos Computer Clubs führte. Heute ist der Chaos Computer Club an vielen Orten vertreten. Wir als Kölner Teil des CCC werden am kommenden Samstag, den 17. September, diesen Geburtstag feiern und laden Euch alle dazu ein.\r\n\r\nDiesen Geburtstag wollen wir mit Wegbegleitern und Interessierten des CCC feiern. Ob Zeitzeugen aus den 30 Jahren, Junghackern oder junggebliebene Althacker – kommt vorbei! Dazu bieten wir Raum für Rückblicke, wie Videos aus alten Tagen, Berichten von coolen Aktionen, in Erinnerungen gebliebene Diskussionen und wo der CCC heute steht. Bringt euer Material mit! Gerne auch partyverträgliche Getränke oder Knabbereien für eine lange Nacht.\r\n", :schedule_yaml => "---\n:start_date: 2011-09-11 16:03:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes:\n- 2011-09-17 19:23:00.000000000 +02:00\n:extimes: []\n", :url => "http://koeln.ccc.de/updates/2011-09-11_XXXCCC.xml", :full_day => false, :category_id => 3, :venue_id => 22, :picture_id => 35)
