Event.create(:id => 57, :name => "dorkbot-ac", :description => "dorkbot ist ein internationales Netz von Gruppen, die Spaß an interaktiver Kunst und elektronischen Hacks haben. Als eine der ersten deutschen Gruppen gibt es dorkbot jetzt auch in Aachen. Wir befassen uns in den Treffen unter anderem mit Arduino Microcontrollerboards.\r\n\r\nWir treffen uns im Raum 2010 im Erdgeschoss. Die Türen des Gebäudes schließen um 19 Uhr. Geh zum Eingang an der Halifaxstraße – dort ist ein Schild mit einer Telefonnummer. Oder ruf die folgende Nummer an: 0241/8021060.", :schedule_yaml => "---\n:start_date: 2011-10-12 18:30:00.000000000 Z\n:duration: 3600\n:rrules:\n- :validations:\n    :day_of_week:\n      3:\n      - 3\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes:\n- 2011-12-14 19:30:00.000000000 +01:00\n:extimes:\n- 2011-12-21 18:30:00.000000000 +01:00\n- 2012-06-20 18:30:00.000000000 +02:00\n- 2012-12-19 18:30:00.000000000 +01:00\n", :url => "http://hci.rwth-aachen.de/dorkbot", :full_day => false, :category_id => 3, :venue_id => 7, :venue_info => "Media Computing Group", :picture_id => 38)
