Event.create(:id => 60, :name => "TEDxKoeln", :description => "TEDx ist ein Programm lokaler eigenständig organisierter Konferenzen, in deren Rahmen Menschen zusammenkommen, um wertvolle Ideen miteinander zu teilen und in die regionale und die globale Welt zu schicken. Bei einem TEDx Event werden neue Verbindungen zwischen Menschen, Themen und Unternehmen geknüpft. Um die Lizenz für einen begehrten TEDx Event zu erhalten, durchlaufen Organisatoren ein ausführliches Auswahlverfahren, in dem ihre Wunschthemen und – orte, aber auch ihre persönlichen Motive geprüft werden. Sie verpflichten sich zur Einhaltung verbindlicher Regeln, um den demokratischen und gemeinnützigen Charakter der TED Idee zu schützen.", :schedule_yaml => "--- \n:start_date: 2011-10-18 10:06:29.374723 +02:00\n:rrules: []\n\n:exrules: []\n\n:rdates: \n- 2011-10-28 20:00:00 +02:00\n:exdates: []\n\n:duration: 3600\n:end_time: \n", :url => "http://www.tedxkoeln.de/", :full_day => true, :category_id => 3, :venue_id => 42)
