Event.create(:id => 63, :name => "Next Level Conference", :description => "Die Next Level Conference nimmt Computerspiele als ausdrucksstarkes und sinnstiftendes Medium ernst.  Die Next Level bietet in Köln ein abwechslungsreiches Programm aus Kunstprojekten und Diskussionen zur Kreativwirtschaft und Kulturellen Bildung, sowie eine lebendige Mischung wissenschaftlicher Vorträge und außergewöhnlicher Spiele zum Ausprobieren. Mit der ersten Next Level Conference im April 2010 hat das NRW KULTURsekretariat in Kooperation mit der Landesregierung NRW ein großes bundesweites Medienecho hervorgerufen. Next Level hat jenseits der bekannten Problematiken, wie den Kontext von Games und Gewalt, den Diskurs um die Relevanz des digitalen Spiels als Kulturgut und Kulturtechnik entscheidend geprägt und vorangebracht.", :schedule_yaml => "---\n:start_date: 2011-10-19 19:19:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes:\n- 2011-11-04 20:00:00.000000000 +01:00\n- 2011-11-05 20:00:00.000000000 +01:00\n:extimes: []\n", :url => "http://www.nextlevel-conference.org/", :twitter => "nextlevelconf", :full_day => true, :category_id => 11, :venue_id => 15, :picture_id => 22)
