Event.create(:id => 98, :name => "SIGINT", :description => "Die SIGINT ist eine Konferenz zu den Diskursen im digitalen Zeitalter, veranstaltet vom Chaos Computer Club e.V. im KOMED in Köln, Deutschland vom 18. bis 20. Mai 2012. Bei der SIGINT geht es um Mitwirkung und Veränderungen, um gesellschaftspolitische Forderungen und Utopien, um Hacktivismus, kreative Normverletzungen und Spaß am Gerät. [Mehr zur SIGINT](http://sigint.ccc.de/SIGINT_2012).", :schedule_yaml => "---\n:start_date: 2012-02-06 15:03:00.000000000 +01:00\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes:\n- 2012-05-18 10:00:00.000000000 +02:00\n- 2012-05-19 10:00:00.000000000 +02:00\n- 2012-05-20 10:00:00.000000000 +02:00\n- 2012-04-11 22:00:00.000000000 +02:00\n:extimes: []\n", :url => "http://sigint.ccc.de", :twitter => "sigint", :full_day => true, :twitter_hashtag => "sigint", :category_id => 3, :venue_id => 81)
Event.create(:id => 99, :name => "Gesellschaft für Informatik eV Köln", :description => "Als öffentliche Veranstaltungen bietet die Regionalgruppe Köln ihren Mitgliedern und weiteren Intertessierten Themenabende an. Ziel eines Themenabends ist die unabhängige Behandlung eines aktuellen Informatik-Themas in angenehmer Atmosphäre mit Gelegenheit zum persönlichen Austausch. Es gibt an einem Abend immer mehrere Vortragende, die ihre vielleicht sogar kontroversen Ansichten in 20minütigen Präsentationen darstellen. In der anschließenden Diskussion hat das Publikum Gelegenheit, weitere Fragen einzubringen.", :schedule_yaml => "---\n:start_date: 2012-02-13 07:57:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes:\n- 2012-02-29 18:00:00.000000000 +01:00\n:extimes: []\n", :full_day => false, :category_id => 3, :venue_id => 66, :picture_id => 24)
Event.create(:id => 100, :name => "Advance Hackathon", :description => "Vom 27. bis zum 29. April treffen sich Entwickler aus ganz NRW und darüber hinaus beim ADVANCE HACKATHON im Coworking Space Gasmotorenfabrik, Köln.\r\n\r\nDas Team: Der Hackathon wird veranstaltet vom Mediencluster NRW in enger Zusammenarbeit mit den Kooperationspartnern 9elements, Railslove und Coworking Cologne.\r\n\r\nDas Ziel: talentierte Web-Entwickler und -Designer an einen Tisch zu bekommen, eigene oder fremde Projekte anzustoßen, gemeinsam Code weiterzuentwickeln, fertig zu stellen oder schlicht zu experimentieren. Das ganze „Grassroot-Style“, also ohne Vorgaben, Sessions, Deadlines oder Themenvorgaben, idealerweise Open Source.\r\n\r\nDas Ergebnis: Von Open Data Maps über Web 2.0 und neuartige Visualisierungen bis hin zu Apps – die Entwickler bestimmen gemeinschaftlich die Projekte, die während des Hackathons umgesetzt werden. Nach der Anmeldung Vorschläge bitte vorab in 140 Zeichen an hackathon@medien.nrw.de senden und im Github Wiki beteiligen und zusammen arbeiten.", :schedule_yaml => "---\n:start_date: 2012-03-08 18:10:00.000000000 +01:00\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes:\n- 2012-04-28 20:00:00.000000000 +02:00\n- 2012-04-29 20:00:00.000000000 +02:00\n- 2012-04-27 18:00:00.000000000 +02:00\n:extimes: []\n", :url => "http://hackathon.advance-conference.com", :twitter => "advanceconf", :full_day => true, :twitter_hashtag => "ah12", :category_id => 3, :venue_id => 82)
