Event.create(:id => 105, :name => "mobile.cologne", :description => "**User group für ios, android, html5  &  co**\r\n\r\nWir wollen Brücken zwischen den mobilen Plattformen schlagen. Es soll das „große Ganze“ der mobilen Software-Entwicklung und dessen Synergien beleuchten werden. Das Ziel dieses Vorhabens ist es, den Blick über den Tellerrand für alle Disziplinen zu erleichtern und somit bessere Produkte einfacher erstellen zu können.\r\n\r\nDie Gegebenheiten in der mobilen Software-Entwicklung ändern sich permanent. Um auf dem Laufenden zu bleiben, wollen wir durch regelmäßige Treffen eine Plattform bieten, dieses zu erleichtern. Wir laden daher zum interdisziplinären Informationsaustausch zwischen ios, android, html5 Entwicklern ein!", :schedule_yaml => "---\n:start_date: 2012-11-01 19:00:00.000000000 Z\n:duration: 7200\n:rrules:\n- :validations:\n    :day_of_week:\n      4:\n      - 2\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes: []\n:extimes:\n- 2013-01-10 19:00:00.000000000 +01:00\n- :time: 2013-05-09 17:00:00.000000000 Z\n  :zone: Berlin\n", :url => "http://www.mobilecologne.de", :twitter => "mobilecgn", :full_day => false, :twitter_hashtag => "mobilecgn", :category_id => 3, :venue_id => 192, :picture_id => 26)
