Event.create(:id => 113, :name => "Role Playing Convention Germany", :description => "Die RPC ist eine Plattform für alle Facetten des Rollenspiels vom PC-Spieler bis zum LARPer, über alle Medien hinweg. Die Zusammenkunft aller Spieler, Nutzer und Anbieter, Clans und Fangruppen stellt eine große Möglichkeit des Austausches für alle Beteiligten dar. Viele Spieler werden sich hier zum ersten Mal treffen und die direkte Interaktion zwischen Produzenten und Zielgruppen lässt auf neue Impulse für den Fortbestand des Rollenspiels in jeglicher Form hoffen.", :schedule_yaml => "---\n:start_date: 2012-05-01 14:51:00.000000000 +02:00\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.rpc-germany.de/", :full_day => true, :category_id => 3, :venue_id => 4)
