Event.create(:id => 117, :name => "Clash of Realities - International Computer Game Conference", :description => "The Clash of Realities is organized by the Department of Media Studies and Media Education and the Cologne Game Lab in cooperation with Electronic Arts (Cologne). Established computer game researchers from Germany, other European countries, and the USA will present papers.\r\n\r\nThe breadth of discussion includes questions and concepts of communication research, neurology, media psychology, educational and social sciences, fine arts, film and image studies, as well as teaching/learning research, media pedagogy, game development and game design", :schedule_yaml => "---\n:start_date: 2012-05-24 06:58:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.clashofrealities.org/", :full_day => true, :category_id => 11, :venue_id => 71)
Event.create(:id => 118, :name => "Medienfest.NRW", :description => "Am 23. und 24. Juni ist es wieder so weit. Das Medienfest.NRW öffnet zwei Tage lang für euch die Tore des MediaPark 6 + 7 in Köln und versorgt euch mit Infos, Vorträgen und Workshops zum Einstieg in die Medienbranche. \r\n\r\nAuch in 2012 haben wir ein abwechslungsreiches Programm für euch zusammengestellt: in über 100 kostenlosen Veranstaltungen wollen wir euch helfen, euren Traumjob zu finden.  Vom 3D-Animationsworkshop über Berichte aus der Berufswelt bis hin zu Bewerbungstipps - da ist bestimmt für jeden von euch etwas dabei.", :schedule_yaml => "---\n:start_date: 2012-05-04 21:14:00.000000000 +02:00\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.medienfest.nrw.de", :twitter => "medienfestnrw", :full_day => true, :category_id => 3, :venue_id => 81)
Event.create(:id => 119, :name => "Düsseldorfer Softwerkskammer Konferenz", :description => "Du hast einen hohen Anspruch an die Software, die Du entwickelst? Sie soll gut vertestet und leicht änderbar sein? Dann komm vorbei! Wir möchten voneinander lernen und uns zu Software Craftsmanship sowie verwandten Themen (Clean Code, TDD, etc.) austauschen.", :schedule_yaml => "---\n:start_date: 2012-06-23 09:00:00.000000000 +02:00\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://groupspaces.com/softwerkskammer/wiki/SoftwerkskammerDUS", :twitter => "softwerkskammer", :full_day => true, :twitter_hashtag => "dsk12", :category_id => 3, :venue_id => 73)
Event.create(:id => 120, :name => "MODX CMS/CMF: Usergroup Cologne/Köln - Meeting", :description => "Wir treffen uns.  [MODX](http://modx.com) CMS/CMF ist das Thema. Und der Ort ist der \"Solution Space\" am Brüsseler Platz 26 in 50674 Köln.\r\n\r\nWir kennen das MODX schon lange oder erst seit Kurzem. Wir sind Experten, Einsteiger oder einfach nur Interessierte. Wir sind Designer, Developer oder was auch immer. Egal, was wir sind, wir treffen uns rund um MODX.  \r\n\r\nUnd wer noch so gar keine Ahnung hat, warum MODX seine neue CMS Welt bedeuten könnte, der kann uns einfach Fragen. Gerne auch vorher:\r\n\r\nTwitter: @macconin @mindeffects #MODX / #MODXCGN\r\nFacebook: http://www.facebook.com/modxdeutschland  \r\n\r\nEine kleine verwegene Bitte: Meldet Euch bitte an. Nicht unverbindlich, sondern – ganz gegen den Trend – einfach mal irgendwie verbindlich. Irre, was? ;-)\r\nhttp://www.facebook.com/events/305694179510863/", :schedule_yaml => "---\n:start_date: 2012-05-15 19:00:00.000000000 +02:00\n:duration: 7200\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.facebook.com/events/305694179510863/", :full_day => false, :twitter_hashtag => "modx", :category_id => 3, :venue_id => 18)
Event.create(:id => 121, :name => "Treffpunkt Semicolon", :description => "## Was ist Semicolon? \r\n\r\nViele Gespräche mit Projektleitern und anderen Führungskräften ergaben: Es besteht ein großer Bedarf an neutralen Informationen und der Wunsch nach Gedankenaustausch mit Kollegen aus anderen Unternehmen. Daher führt der \"Treffpunkt Semicolon\" regelmäßig ca. zehn Mal im Jahr abendliche kostenlose Informationsveranstaltungen durch. \r\n\r\n## Was bietet der Treffpunkt \"Semicolon\"? \r\n\r\n* kompakte hard- und softwarehersteller-unabhängige Infos\r\n* Vorträge von kompetenten Dozenten mit viel Praxiserfahrung\r\n* Diskussionsrunden im Forum\r\n* Gelegenheit für individuelle Gespräche beim anschließenden Imbiss\r\n\r\nWeitere Informationen findet man [hier](http://www.gfu.net/semicolon.html).", :schedule_yaml => "---\n:start_date: 2012-05-21 18:27:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.meetup.com/Treffpunkt-Semicolon", :full_day => false, :category_id => 3, :venue_id => 17)
