Event.create(:id => 126, :name => "CAcert Events", :description => "CAcert ist eine gemeinschaftsbetriebene, nicht-kommerzielle Zertifizierungsstelle (Certification Authority, Root-CA oder kurz CA), die kostenfrei X.509-Zertifikate für verschiedene Einsatzgebiete ausstellt. Damit soll eine Alternative zu den kommerziellen Root-CAs geboten werden, die zum Teil recht hohe Gebühren für ihre Zertifikate erheben. ([Quelle](http://de.wikipedia.org/wiki/CAcert))\r\n\r\nCAcert bietet in unregelmäßigen Abständen Schulungen und Treffen an.", :schedule_yaml => "---\n:start_date: 2012-06-19 17:26:13.814558829 +02:00\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.cacert.org/", :full_day => false, :category_id => 3)
