Event.create(:id => 129, :name => "Braincamp", :description => "BrainCamp – die lockere, inspirierende Diskussions- und Networking-Plattform für Kreative, Macher und Newbies aus den Bereichen Mobile, Web- und Software-Entwicklung.\r\n \r\nBasierend auf dem BarCamp-Konzept bestimmen die Teilnehmer des BrainCamp das Programm beider Veranstaltungstage selbst. Im Gegensatz zu den offenen BarCamps ist das BrainCamp ein ThemenCamp: Der Fokus liegt auf Inhalten aus den Bereichen Mobile, Web- und Software-Entwicklung.\r\nJeder kann seine Sessionvorschläge schon jetzt eintragen. Die endgültige Sessionplanung erfolgt dann wie gewohnt nach der Begrüßungsrunde - mit dem Ziel, ein vielfältiges Vortragsprogramm inklusive „rotem Faden“ für die Camper zu schaffen. Dabei sollte jeder Session nicht länger als 45 Minuten dauern. ", :schedule_yaml => "---\n:start_date: 2012-06-27 20:14:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://braincamp-cologne.com", :twitter => "BrainCampCGN", :full_day => true, :twitter_hashtag => "bcCGN13", :category_id => 3, :venue_id => 74, :picture_id => 197)
