Event.create(:id => 132, :name => "Backen mit Mate und Nerds", :description => "Der C4 lädt zu einem kurzen Vortrag mit anschließendem gemeinsamen Backen mit Mate ein.\r\nMate ist das Kultgetränk unter Hackern und Nerds. Man kann es aber nicht nur trinken sondern auch zum Backen verwenden. Von Mate-Waffeln bis hin zu Tschunk-Kuchen sind alle Variationen möglich. Mate gibt dem Essen einen besonderen Geschmack und einen Koffein-Kick.\r\n\r\nDen Vortrag hält Michaela aus dem Düsseldorfer Hackerspace Chaosdorf.\r\n\r\nDas Chaos Computer Club Cologne Café (C5) findet samstags nach Ankündigung statt. Der Eintritt ist dabei wie gewohnt frei, auch wenn Spenden in die ‘Kaffee-Kasse’ oder an den C4 allgemein gern gesehen sind.\r\nDas C5 ist am 21. Juli 2012 in den Räumlichkeiten des Chaos Computer Club Cologne. Beginn ist 15:00 Uhr.", :schedule_yaml => "---\n:start_date: 2012-07-16 15:00:00.000000000 Z\n:duration: 10800\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://koeln.ccc.de/updates/2012-07-15_C5_Backen-mit-Mate.xml", :twitter => "ccc_koeln", :full_day => false, :category_id => 10, :venue_id => 75)
