Event.create(:id => 143, :name => "hackanoon - hackathon in the afternoon", :description => "The hackanoon is the hackathon in the afternoon. \r\nSo what happens at a hackanoon?\r\nThe participants meet up at 12pm for Pizza, pitch each other ideas or technical challenges they find interesting to work on. \r\nIn the afternoon teams hack on these ideas and pitch the results / learnings over beer at 6pm.  \r\n\r\nWe held 5 hackanoons before. Read about one of them at [right here](http://blog.munichbeta.de/hackanoon-4).\r\n\r\nApply for to this free event on our website.", :schedule_yaml => "---\n:start_date: 2012-09-04 07:00:00.000000000 +02:00\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://hackanoon.com", :twitter => "hackanoon", :full_day => true, :category_id => 3, :venue_id => 82)
Event.create(:id => 144, :name => "SPIEL - Internationale Spieltage", :description => "Die Internationalen Spieltage - weltweit größte Publikumsmesse für Spiele - bieten ihren Besuchern eine einmalige Möglichkeit, sich umfassend über das gesamte nationale und internationale Spieleangebot zu informieren und dieses einem ausführlichen Test zu unterziehen. Nirgendwo sonst finden Sie die gesamte Spielszene so umfassend versammelt. Verlage, Autoren, Hersteller und natürlich Spieler treffen sich hier einmal im Jahr, um Erfahrungen auszutauschen, sich über das Neueste zu informieren und ihre Produkte einer breiten Öffentlichkeit vorzustellen.", :schedule_yaml => "---\n:start_date: 2012-09-12 19:37:00.000000000 +02:00\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.internationalespieltage.de", :full_day => true, :category_id => 3, :venue_id => 83)
Event.create(:id => 145, :name => "Anykey0xde SMD Lötworkshop", :description => "In diesem Workshop werden wir ein Anykey0x.de Entwicklungsboard löten.\r\nDas Anykey0x.de Board ist ein winziges Prototyping- und Entwicklungsboard. Es eignet sich zum Bauen von USB-Peripheriegeräten, für eigenständige Schaltungen oder um einfach Spaß mit einem leistungsfähingen Mikrocontroller zu haben.\r\n\r\nAuf den ersten Blick wirkt das Löten von Surface Mount Devices (SMD) abschreckend: Die Teile sind winzig. Im Workshop wird gezeigt, dass SMD-Löten viel einfacher ist als es aussieht. SMD-Technik eröffnet eine Welt neuer Möglichkeiten, weil die meisten modernen Bauteile nicht in der alten “Through Hole”-Bauform verfügbar sind – von aktuellen Mikrocontrollern bis zu MEMS-Gyrosensoren.\r\n\r\nDer Workshop ist mehr ist als das dumpfe Nachlöten eines Bausatzes. Während des Lötens werden wir die Funktionsweise der Schaltung erklären, damit Teilnehmer ein Verständnis dafür bekommen, was die einzelnen Teile tun und wie sie in der Schaltung zusammenarbeiten.\r\n\r\nDas Board nutzt einen leistungsfähigen 32-Bit, 72 MHz ARM Cortex M3 Microcontroller, enthält einen Full Speed USB Port, eine LED, einen Taster und Lötkontakte für die wichtigsten Prozessorenpins. Das Boarddesign und das SDK sind vollständig Open Source. Das Board ist nicht schwieriger zu programmieren als Arduinos, aber wesentlich leistungsfähiger.\r\n\r\nNach dem Zusammenbau werden wir einen kurzen Einblick in die Programmierung des Boards geben. Bei größerer Nachfragen kann auch ein intensiv Workshop ARM Entwicklung vereinbart werden.\r\n\r\nGeschätzte Dauer: Ungefähr 4 Stungen (open end)\r\nKosten: 25 € (Dingfabrik-Mitglieder: 20 €) Der Bausatz ist im Preis inbegriffen.\r\nVorkenntnisse: Keine erforderlich\r\nWerkzeug: Wir bringen alle notwendigen Werkzeuge und Hilfsmittel mit\r\n(Brillenträger: Bitte eine passende Lupe o.ä. mitbringen)\r\n\r\nMehr Infos: www.anykey0x.de / @anykey0xde / info@anykey0x.de", :schedule_yaml => "---\n:start_date: 2012-09-26 22:17:00.000000000 +02:00\n:duration: 14400\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "https://dingfabrik.de/events/198/anykey-smd-workshop/", :twitter => "anykey0xde", :full_day => false, :category_id => 3, :venue_id => 54)
