Event.create(:id => 171, :name => "Pecha Kucha Köln", :description => "Ein Pecha Kucha Vortrag besteht aus 20 Bildern á 20 Sekunden.\r\n20 Sekunden: jedes Bild wird für exakt 20 Sekunden lang gezeigt, die Bilder wechseln automatisch, der Vortragende hat keinen Einfluss darauf.\r\nDie Reihenfolge der Bilder legt der Vortragende fest.\r\nWir kümmern uns um die technische Seite (Arrangieren der Bilder, Rechner, Beamer usw.).\r\nDu erzähltst etwas zu deinen Bildern – insgesamt hast Du 6 Minuten und 40 Sekunden.", :schedule_yaml => "---\n:start_date: 2012-11-18 13:55:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://pechakucha.de/cologne/pecha-kucha/", :full_day => false, :category_id => 1, :picture_id => 61)
