Event.create(:id => 205, :name => "Arbeitsmarktkonferenz Medien und Kultur", :description => "Seit 2007 richtet die Arbeitsmarktkonferenz den Blick auf die Medien- und Kulturschaffenden, auf die Unternehmen aus Kultur- und Medienwirtschaft und auf die Kultur-Institutionen. Es geht um Veränderungen, Umbrüche und Zukunftsperspektiven in den kreativen Branchen.\r\n\r\nDie Konferenz wendet sich an jüngere wie erfahrene Profis, an Unternehmen, an Multiplikator/innen aus Wissenschaft, Wirtschaft, Politik und Verwaltung.\r\nZu dem bewährten Veranstalterkreis: Stadt Köln, SK Stiftung Kultur, Agentur für Arbeit Köln, AIM / sk stiftung jugend und medien wird 2013 als weiterer Mit-Veranstalter die Industrie- und Handelskammer zu Köln hinzukommen. ", :schedule_yaml => "---\n:start_date: 2013-01-02 14:17:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.arbeitsmarktkonferenz.net", :full_day => false, :category_id => 5, :venue_id => 81)
