Event.create(:id => 212, :name => "Zukunftswerkstatt e.V.", :description => "Kultur und Wissensvermittlung.\r\n\r\nDas moderne Internet und die Welt der Computerspiele haben einen nachhaltigen und tiefgreifenden Einfluss auf die Kultur- und Wissensvermittlung. Kultur- und Bildungsinstitutionen, Unternehmen und Einzelpersonen sind auf diese neuen Kommunikations- und Vermittlungsplattformen in der Regel kaum vorbereitet.\r\n\r\nDer Verein Zukunftswerkstatt Kultur- und Wissensvermittlung e.V. möchte dies ändern. Hierfür haben wir eine Vielzahl an unterschiedlichen Aktivitäten gestartet:", :schedule_yaml => "---\n:start_date: 2013-01-09 14:58:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.zukunftswerkstatt.org/", :twitter => "zw09", :full_day => false, :category_id => 5, :picture_id => 120)
