Event.create(:id => 216, :name => "Draw by Night", :description => "Die Idee:\r\n\r\nAlle zwei Monate ein Event, bei dem kreative Menschen zusammenkommen, sich austoben und austauschen können.\r\n\r\nWir stellen:\r\n\r\nLocation, Thema, Basis-Materialien, und die passende Live-Musik – und freuen uns auf Amateure und Profis aus möglichst allen Sparten (Malerei, Zeichnung, Graphik/Design, Photo/Video und was immer ihr sonst noch zu bieten habt!), die Lust haben, sich kreativ auszutoben, dabei dem ein oder anderen über die Schulter zu schauen, selbst Feedback zu bekommen (wenn gewünscht) und Gleichgesinnte kennenzulernen.\r\nUnser Partner dabei ist das Charity-Projekt „CelebrAid“, mit dem wir über evtl. Gewinne gemeinnützige Projekte in und um Köln unterstützen möchten.", :schedule_yaml => "---\n:start_date: 2013-01-14 16:13:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://cologne.drawbynight.de", :full_day => false, :category_id => 10, :picture_id => 125)
