Event.create(:id => 224, :name => "Open FabLab", :description => "Offener Werkstattabend und 3D-Druck im GarageLab.\r\n\r\nDas GarageLab verbindet digitale Produktion, Handwerk und Elektronik. Mitten in Düsseldorf. Gegründet 2011 arbeiten wir gemeinnützig an realen Dingen. Denn Probieren geht über Simulieren.\r\n\r\nReinschauen, Staunen, mitmachen, Fragen, vernetzen!\r\n\r\nJeden 2. und 4. im Dienstag im Monat ist das GarageLab offen für alle! Komm’ einfach vorbei und sehe mit eigenen Augen, was wir machen. Und wie wir es machen. 100% kostenlos und mit absolutem “Neugierbefriedigungsfaktor“.\r\n\r\nSpreche mit unseren Mitgliedern, hole Dir Tipps und Anregungen für Deine Projekte bei einem Kaffee oder bringe einfach Dein Werkstück gleich mit.\r\n\r\nUngezwungen, locker und vor allem sehr kommunikativ geht das Open FabLab meist bis spät in den Abend. Dabei wird gezeichnet, modelliert, gesägt, gedruckt, genäht, gelötet, gesponnen – gelacht!\r\n\r\nUnd wenn Du nicht nur Dienstags unser Schaffen bestaunen willst, sondern auch ein Teil unseres Vereins werden willst, dann kannst Du vor Ort gleich Mitglied werden.\r\n\r\nAlso: Einfach vorbeikommen und mitmachen – jeden 2. und 4. Dienstag im Monat ab 19 Uhr!", :schedule_yaml => "---\n:start_date: 2013-01-22 19:00:00.000000000 Z\n:duration: 3600\n:rrules:\n- :validations:\n    :day_of_week:\n      2:\n      - 2\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n- :validations:\n    :day_of_week:\n      2:\n      - 4\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://garage-lab.de/veranstaltungen/", :full_day => false, :category_id => 10, :venue_id => 48, :venue_info => "Hinterhof", :picture_id => 133)
Event.create(:id => 225, :name => "GarageLab e.V.", :description => "Das FabLab in Düsseldorf.\r\n\r\nDas GarageLab in Düsseldorf verbindet digitale Produktion, Handwerk und Elektronik. Mitten in Düsseldorf. Gegründet 2011 arbeiten wir gemeinnützig an realen Dingen. Wir verbinden Kreative, Tüftler, Freaks, Wissenshungrige, Künstler und Bastler zu einer innovativen und originellen Gemeinschaft. Jedweder Herkunft, egal welchen Alters und unabhängig von Vorkenntnissen. Das GarageLab will aus Ideen Wirklichkeit werden lassen.", :schedule_yaml => "---\n:start_date: 2013-01-22 14:58:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://garage-lab.de/", :full_day => false, :category_id => 10, :venue_id => 48, :venue_info => "Im Hinterhof", :picture_id => 133)
