Event.create(:id => 235, :name => "Safer Internet Day", :description => "Am 5. Februar 2013 ist es wieder so weit: Auf Initiative der Europäischen Kommission rücken weltweit Veranstaltungen und Aktionen das Thema \"Sicherheit im Netz\" in den Mittelpunkt. In Deutschland initiiert und koordiniert klicksafe erneut die nationalen Aktivitäten mit dem Ziel, möglichst viele Akteure und Institutionen für eine Beteiligung in eigener Regie zu gewinnen. In diesem Jahr steht der Safer Internet Day international unter dem Motto \"Online Rights and Responsibilities\".", :schedule_yaml => "---\n:start_date: 2013-02-01 16:03:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.klicksafe.de/ueber-klicksafe/safer-internet-day/sid-2013/", :full_day => false, :category_id => 5, :venue_info => "Köln")
Event.create(:id => 236, :name => "betahaus Köln", :description => "Das betahaus ist eine Plattform, die den Ansprüchen von unabhängigen Kreativen und Wissensarbeitern gerecht wird und ihre Möglichkeiten erweitert. In einer Mischung aus entspannter Kaffeehaus-Atmosphäre und konzentriertem Arbeitsumfeld legen wir Raum zwischen Arbeit und Privatsphäre an, in der Innovation und Kreativität gefördert wird.", :schedule_yaml => "---\n:start_date: 2013-02-03 14:41:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :full_day => false, :category_id => 2, :venue_id => 28)
