Event.create(:id => 239, :name => "tweetcamp", :description => "Das BarCamp rund um Twitter im Sommer 2013 in Köln.\r\n\r\nSeit 2006 wird via Twitter fleißig gezwitschert und auch in Deutschland erfreut sich der Echtzeit-Kurznachrichtendienst wachsender Beliebtheit. Aber was beschäftigt die Twitter-Community tagtäglich? Welche Möglichkeiten bietet die API aus technologischer Sicht und welchen gestalterischen Spielraum hat ein Designer, wenn es darum geht, die Twitter-Technologie grafisch oder gar spielerisch in ein Gesamtkonzept zu schustern und welchen rechtlichen Rahmen gilt es hierbei zu beachten? Diesen und weiteren Fragen möchte wir während des zweitägigen TweetCamps im Sommer 2013 auf den Grund gehen.", :schedule_yaml => "---\n:start_date: 2013-02-04 10:27:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :twitter => "tweetcamp_de", :full_day => false, :twitter_hashtag => "tck13", :category_id => 1, :picture_id => 146)
Event.create(:id => 240, :name => "WebWorker NRW Treffen", :description => "Angesprochen sind alle, die sich mit der Thematik “Webentwicklung” beschäftigen: Solo oder im großen Team, Grafiker, Frontendler oder Backendler gleichermaßen.\r\nEs geht darum, voneinander zu lernen und über den eigenen Tellerrand zu blicken. Und das idealerweise als Hands-on mit Fragerunde, ohne ausgefeilte Powerpoint-Präsentationen!\r\n\r\nVeranstalter ist [Christian Schaefer](http://twitter.com/#!/derSchepp).", :schedule_yaml => "---\n:start_date: 2013-02-05 19:00:00.000000000 Z\n:duration: 3600\n:rrules:\n- :validations:\n    :day_of_week:\n      4:\n      - 2\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.garagebilk.de/termin/webworker-nrw-treffen-5/", :full_day => false, :category_id => 3, :venue_id => 48)
Event.create(:id => 241, :name => "Kölner Forum Medienrecht", :description => "Das kölner forum medienrecht (kfm) schafft eine feste Plattform, die wissenschaftliches und praktisches Know-How bündelt.\r\n\r\nEs dient der Ausrichtung von Veranstaltungen, um neuartige medienrechtliche Problemstellungen zu lösen und Fachwissen zu vermitteln.", :schedule_yaml => "---\n:start_date: 2013-02-05 20:31:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.koelner-forum-medienrecht.de", :full_day => false, :category_id => 1, :picture_id => 147)
