Event.create(:id => 243, :name => "Bames - Digitale Spielkultur", :description => "Netzwerk und Veranstaltungsreihe von und für Menschen, die sich für digitale Spiele interessieren. Der Fokus besteht darin, Menschen mit einer Vielzahl an Perspektiven zusammenzubringen - und private, berufliche, wissenschaftliche, künstlerische, industrielle Blickwinkel auf digitale Spiele auszutauschen.\r\n\r\nBames sind dabei bewusst nicht exklusiv, also weder auf Kölner beschränkt, noch auf eine notwendig professionelle Sichtweise auf Games.\r\n\r\nBames finden seit 2010 regelmäßig in Köln statt.", :schedule_yaml => "---\n:start_date: 2013-02-06 08:21:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.bames.de/", :full_day => false, :twitter_hashtag => "bames", :category_id => 11, :picture_id => 149)
Event.create(:id => 244, :name => "Mobile World Live TV ", :description => "Mobile World Live TV will return in 2013 to broadcast live from Mobile World Congress and will also be available to more than 70,000 event attendees throughout the venue via numerous monitors strategically located within the Fira Gran Via. In addition, the channel will be streamed live to our selection of apps and to the [Mobile World Live website](http://www.mobileworldlive.com/mobile-world-live-tv-2013).", :schedule_yaml => "---\n:start_date: 2013-02-08 12:21:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.mobileworldlive.com/mobile-world-live-tv-2013", :full_day => false, :category_id => 15, :venue_info => "http://www.mobileworldlive.com/mobile-world-live-tv-2013", :picture_id => 152)
Event.create(:id => 245, :name => "Learn with Google Köln", :description => "Kostenlose Online Marketing Trainings von Google.\r\n\r\nDas kostenfreie Schulungsangebot von Google ist für alle Interessierten aus Bereichen wie KMU, Media- und Kreativagenturen sowie für Studierende offen und in zwei Kurse gegliedert: In der „Fundamentals“-Stufe werden Grundkenntnisse vermittelt und die darauf aufbauende „Advanced“-Stufe bietet Expertenwissen, das bis hin zur Planung von Kampagnen reicht. Im Anschluss an die erfolgreiche Kursteilnahme kann zudem ein weltweit gültiges Zertifikat – das „Google AdWords Certificate“ erworben werden.", :schedule_yaml => "---\n:start_date: 2013-02-08 12:38:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://adwords-training-live.appspot.com/", :full_day => false, :category_id => 1, :picture_id => 153)
Event.create(:id => 246, :name => "IHK Köln", :description => "Die IHK Köln ist Partner und Fürsprecher der Unternehmen und Kaufleute in der Region Köln. Sie vertritt die Interessen von rund 148.500 Mitgliedsunternehmen.\r\n\r\nAls öffentlich-rechtliche Körperschaft gestaltet sie neue Berufsbilder und stellt die Standards bei Aus- und Weiterbildungsprüfungen sicher. Die IHK Köln bietet vielfältige Dienstleistungen für Unternehmen, von der Ausbildung bis zu Fragen der Unternehmenspraxis. Aktuelle Veranstaltungen zu einer Vielzahl von Themen und zahlreiche Netzwerk-Angebote machen sie zum Zentrum wirtschaftlichen Handelns in Köln.\r\n\r\n[Quelle.](http://www.ihk-koeln.de/Ihre_IHK_Koeln.AxCMS?ActiveID=1306)", :schedule_yaml => "---\n:start_date: 2013-02-08 12:59:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.ihk-koeln.de", :full_day => false, :category_id => 2, :picture_id => 154)
Event.create(:id => 247, :name => "enGAGE!", :description => "**Gesprächs- und Arbeitskreis Geistiges Eigentum**\r\n\r\nDer Gesprächs- und Arbeitskreis Geistiges Eigentum (enGAGE!) e.V. ist eine Initiative für einen unabhängigen wissenschaftlichen Diskurs über die Bedeutung des Geistigen Eigentums für den Erhalt der Kultur. \r\n\r\nEs gilt Bewusstsein für den erodierenden Wert des Geistigen Eigentums zu erzeugen, um das Geistige Eigentum und das Urheberrecht als rechtlichen Anker kulturellen Schaffens zu erhalten. ", :schedule_yaml => "---\n:start_date: 2013-02-08 19:21:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://engage.fh-koeln.de/", :full_day => false, :category_id => 7, :picture_id => 156)
Event.create(:id => 248, :name => "Digitales Quartett", :description => "Gäste aus der digitalen Welt diskutieren über den Medienwandel: Von der Netzpolitik hin zu Gadgets. Über digitale Trends, Aufreger und Phänome die unsere Gesellschaft beeinflussen — oder auch nicht.\r\n\r\nSenden gegen langweiliges Fernsehprogramm an.\r\n\r\nDas Digitales Quartett ist ein Projekt von Thomas Knüwer (www.indiskretionehrensache.de & @tknuewer), Franziska Bluhm (www.franziskript.de & @franziskript) und Daniel Fiene (www.wasmitmedien.de & @fiene).", :schedule_yaml => "---\n:start_date: 2013-02-08 21:00:00.000000000 Z\n:duration: 3600\n:rrules:\n- :validations:\n    :day_of_week:\n      1:\n      - 1\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n- :validations:\n    :day_of_week:\n      1:\n      - 2\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n- :validations:\n    :day_of_week:\n      1:\n      - 3\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n- :validations:\n    :day_of_week:\n      1:\n      - 4\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n- :validations:\n    :day_of_week:\n      1:\n      - 5\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes: []\n:extimes:\n- 2013-02-25 21:00:00.000000000 +01:00\n", :url => "http://www.youtube.com/user/digitalesquartett/", :full_day => false, :twitter_hashtag => "quartett", :category_id => 15, :picture_id => 157)
Event.create(:id => 249, :name => "Forum Volkshochschule", :description => "Seit 1969 wurden im Forum der Volkshochschule in direkter Nachbarschaft zum 1965 eröffneten VHS-Studienhaus drei multifunktionale Säle mit einem anspruchsvollen Veranstaltungsangebot gefüllt. Hier war der Ort für Diskurse über zeitaktuelle Themen mit Prominenten aus Politik, Wissenschaft und Kultur. 2003 wurde dieses Forum und die Josef-Haubrich-Kunsthalle in Vorbereitung für den Neubau des Rautenstrauch-Joest-Museums abgerissen.\r\n\r\nBestandteil des Museumsneubaus ist nun ein Veranstaltungssaal der VHS, das Forum Volkshochschule, der für 300 Personen Platz bietet.", :schedule_yaml => "---\n:start_date: 2013-02-08 21:34:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.stadt-koeln.de/5/volkshochschule/06862/", :full_day => false, :category_id => 7, :picture_id => 158)
