Event.create(:id => 262, :name => "Softwerkskammer", :description => "Wir sind eine Community of Professionals, die über ganz Deutschland verteilt sind. Uns geht es darum, gute Software zu entwickeln, und zwar im Hinblick auf alle Aspekte:\r\n\r\n- Wir möchten voneinander lernen und Erfahrungen austauschen\r\n- Wir möchten die Software erstellen, die der Kunde wirklich braucht\r\n- Wir möchten sicherstellen, dass unsere Ergebnisse eine hohe interne und externe Qualität besitzen\r\n- Wir möchten flexible, leicht änderbare Software herstellen\r\n\r\nKurz: Wir wollen die richtige Software entwickeln, und wir wollen die Software richtig entwickeln.", :schedule_yaml => "---\n:start_date: 2013-02-25 16:21:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.softwerkskammer.de", :full_day => false, :category_id => 3, :picture_id => 177)
