Event.create(:id => 264, :name => "Kongress CREATIVE.Arbeit", :description => "Wie können Impulse aus Unternehmen und Initiativen der Kreativwirtschaft für eine nachhaltige Wirtschaft und Gesellschaft genutzt werden? Dieser Frage widmet sich der Kongress CREATIVE.ARBEIT. Im Mittelpunkt der Veranstaltung steht die Diskussion über neue Arbeitsmodelle und Organisationsformen. Wir wollen Anstöße für kreative Arbeit geben und aufzeigen, welche Potenziale die Kreativwirtschaft für Innovationen in Wirtschaft und Gesellschaft bietet.\r\n\r\nDie Veranstaltung wird organisiert vom Ministerium für Wirtschaft, Energie, Industrie, Mittelstand und Handwerk des Landes NRW und CREATIVE.NRW, dem Cluster Kultur und Kreativwirtschaft.", :schedule_yaml => "---\n:start_date: 2013-02-26 14:50:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://creative.nrw.de/creative-arbeit", :twitter => "CREATIVE_NRW", :full_day => false, :category_id => 2, :picture_id => 179)
Event.create(:id => 265, :name => "Df | Experience Cologne", :description => "The Df Conference Series about UX, Customer Experience and Service Design. No audience, just participants. The action conference, with the wild mix of talks, workshops, competition and party.\r\n\r\nStarted as Design for Conversion in 2008, we now aim to bring the action conference format to the whole world as Df Conference Series. Every Df is one day with non-stop action: workshops, challenges, real life case studies, keynotes by world famous speakers, competition and party. ", :schedule_yaml => "---\n:start_date: 2013-03-01 10:26:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://designfor.at", :twitter => "dfseries", :full_day => false, :twitter_hashtag => "dfecgn", :category_id => 6, :picture_id => 180)
