Event.create(:id => 273, :name => "Politische Bildung in NRW", :description => "Das Heinz-Kühn-Bildungswerk (Dortmund/Köln), das Willi-Eichler-Bildungswerk (Köln), die Akademie für politische Bildung & Information (Bonn) und das Bildungswerk Stenden (Düsseldorf) sind nach dem Weiterbildungsgesetz NRW anerkannte Einrichtungen der politischen Erwachsenenbildung. Wir haben uns als Kooperationspartner zusammengeschlossen, und machen vor allem im Rheinland und Westfalen Angebote zur politischen Bildung. In Einzelveranstaltungen, in Seminarreihen, in Trainings und in Studienreisen wollen wir Beiträge leisten, um Bürgerinnen und Bürger für politisches Handeln zu bilden und zu qualifizieren.", :schedule_yaml => "---\n:start_date: 2013-03-08 15:24:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.bildungswerke-rheinland.de/", :full_day => false, :category_id => 5)
