Event.create(:id => 278, :name => "Medienfrauen NRW", :description => "Was machen die Frauen, die in NRW in einem der vielen Medienberufe arbeiten? Wie sieht ihr Alltag aus, welche Ausbildung haben sie hinter sich? Was haben sie erreicht – und wie kommt man dahin? Bei der Veranstaltung “Medienfrauen NRW” erfährst du, wie es gehen kann: Frauen, die schon seit Jahren dabei sind, treffen auf die, die noch am Anfang ihrer Ausbildung oder ihres Werdegangs stehen, und auf die, die es ihnen beibringen.\r\n\r\nDie Medienfrauen NRW sind ein Projekt des Grimme-Instituts und werden von der Ministerin für Bundesangelegenheiten, Europa und Medien des Landes NRW gefördert.", :schedule_yaml => "---\n:start_date: 2013-03-12 15:01:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.medienfrauen-nrw.de/", :full_day => false, :category_id => 5, :picture_id => 193)
