Event.create(:id => 282, :name => "Fraunhofer FOKUS ", :description => "Fraunhofer-Institut für Offene Kommunikationssystem\r\n\r\nFraunhofer FOKUS entwickelt als neutrale Forschungseinrichtung Lösungen für die Kommunikationssysteme der Zukunft. Das Berliner Institut erforscht, welchen Beitrag Kommunikationsnetze leisten müssen, um das Zusammenleben komfortabler und sicherer zu gestalten und adressiert dabei wichtige Herausforderungen der gesellschaftlichen Entwicklung. \r\n\r\nFraunhofer FOKUS konzentriert sich dabei nicht nur auf die technische Infrastruktur, sondern entwickelt darüber hinaus praktikable Konzepte, Anwendungen und Prototypen. Im Zentrum der Forschungsaktivitäten steht die Entwicklung von domain- und organisationsübergreifenden Netzwerken sowie von interoperablen, benutzerzentrierten Lösungen.", :schedule_yaml => "---\n:start_date: 2013-03-20 10:54:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.fokus.fraunhofer.de", :full_day => false, :category_id => 3, :picture_id => 198)
Event.create(:id => 283, :name => "Friedrich-Ebert-Stiftung", :description => "Die Friedrich-Ebert-Stiftung (FES) wurde 1925 als politisches Vermächtnis des ersten demokratisch gewählten deutschen Reichspräsidenten Friedrich Ebert gegründet.\r\n\r\nDie FES, von den Nationalsozialisten 1933 verboten und 1947 wiederbegründet, verfolgt mit ihren umfangreichen Aktivitäten diese Ziele bis heute. Als eine gemeinnützige, private und kulturelle Institution ist sie den Ideen und Grundwerten der sozialen Demokratie verpflichtet.\r\n\r\n**Die FES will mit ihren Aktivitäten:**\r\n\r\n- Die politische Erneuerung der sozialen Demokratie fördern\r\n- Politische Teilhabe und gesellschaftlichen Zusammenhalt stärken\r\n- Die Wirtschafts- und Sozialordnung gerecht gestalten\r\n- Den Dialog zwischen Gewerkschaften und Politik vertiefen\r\n- Die Globalisierung sozial gestalten", :schedule_yaml => "---\n:start_date: 2013-03-20 11:16:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.fes.de", :full_day => false, :category_id => 7, :picture_id => 199)
Event.create(:id => 284, :name => "eco Kongress", :description => "Der eco Kongress findet seit 2006 in Köln statt. Jedes Jahr greift der eco Kongress aktuelle Themen und Trends der Internetwirtschaft auf und wagt Ausblicke auf die sich schnell wandelnde Zukunft dieser innovativen Branche. \r\n\r\nZu den Besuchern des eco Kongresses zählen Fachleute aus der Internetwirtschaft. Fachkollegen treffen sich zum Austausch, nehmen neue Impulse mit in ihre Unternehmen und informieren sich bei Sponsoren und Ausstellern über die Entwicklung der Internetbranche. Jährlich nutzen rund 150 Teilnehmer, unter ihnen mehr als 25 Prozent Vorstände und Geschäftsführer, den eco Kongress zur Information und Kommunikation.", :schedule_yaml => "---\n:start_date: 2013-03-20 11:52:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.eco.de/veranstaltungen/kongress-news", :full_day => false, :category_id => 5, :venue_id => 218)
Event.create(:id => 285, :name => "INTERACTIVE MEDIA", :description => "Das Weiterbildungsprogramm Interactive Media wird organisiert von der Internationalen Filmschule Köln.\r\n\r\nDie berufsbegleitende Weiterbildung Interactive Media bietet einen Überblick über den Markt der nonlinearen und digitalen Medien. Die TeilnehmerInnen werden in die elementaren Denkstrukturen eingeführt, die für die planerische und kreative Arbeit an solchen Produkten erforderlich ist, und erfahren, wie neue Medien finanziert und realisiert werden können.\r\n\r\nInteractive Media richtet sich an Medienschaffende (Produzenten, Redakteure, Assistenten, Regisseure, Autoren, Texter, Designer) aus den Bereichen der klassischen Medien (Film, Fernsehen, Print, Literatur, Radio, Musik, Marketing, Werbung), die sich theoretisch und praktisch mit neuen Medien vertraut machen wollen und alle, die sich in ihrem Berufsalltag plötzlich mit neuen und interaktiven Medienformaten auskennen sollen.", :schedule_yaml => "---\n:start_date: 2013-03-20 12:25:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://interactivemedia.filmschule.de", :full_day => false, :category_id => 5, :picture_id => 201)
