Event.create(:id => 287, :name => "Python Meeting Düsseldorf", :description => "Ein Treffen von Python Enthusiasten und Interessierten in ungezwungener Atmosphäre.\r\n\r\nWir starten bei den Treffen mit einer kurzen Einleitung und gehen dann zu einer Reihe Kurzvorträgen (Lightning Talks) über, bei denen die Anwesenden über neue Projekte, interessante Probleme und sonstige Aktivitäten rund um Python berichten können. Anschließend geht es in eine Gaststätte, um die Gespräche zu vertiefen.\r\n\r\nVeranstaltet wird das Meeting von der eGenix.com GmbH, Langenfeld,  in Zusammenarbeit mit Clark Consulting & Research, Düsseldorf.\r\n\r\nUnkostenbeitrag: 5/10 €", :schedule_yaml => "---\n:start_date: 2013-03-21 09:35:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://pyddf.de/", :full_day => false, :category_id => 3, :picture_id => 203)
