Event.create(:id => 289, :name => "Games for Change", :description => "**Our Mission Statement:** Catalyzing Social Impact Through Digital Games\r\n\r\n**What we do:** Founded in 2004, Games for Change facilitates the creation and distribution of social impact games that serve as critical tools in humanitarian and educational efforts.\r\n\r\nUnlike the commercial gaming industry, we aim to leverage entertainment and engagement for social good. To further grow the field, Games for Change convenes multiple stakeholders, highlights best practices, incubates games, and helps create and direct investment into new projects.\r\n\r\nTo learn more about our current and past projects, visit our Services page.\r\n\r\nGames for Change is a 501(c)3, nonprofit corporation.", :schedule_yaml => "---\n:start_date: 2013-03-21 10:26:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.gamesforchange.org", :twitter => "g4c", :full_day => false, :category_id => 11)
