Event.create(:id => 301, :name => "IHK Düsseldorf", :description => "Die IHK Düsseldorf, eine der größten deutschen Industrie- und Handelskammern, vertritt die Interessen von rund 79.000 Mitgliedsunternehmen aus Industrie, Handel und Dienstleistungen in der Landeshauptstadt Düsseldorf und den zehn Städten des Kreises Mettmann.\r\n\r\nDie IHK Düsseldorf bietet ihren Mitgliedsunternehmen eine Vielzahl von Dienstleistungen an. Sie berät in Fragen des Handels-, Gesellschafts-, Gewerbe-, Steuer-, Arbeits- und Wettbewerbsrechts. Für Existenzgründer bietet sie beispielsweise einen kompletten Informationsservice durch persönliche Beratung, Seminare und schriftliche Unterlagen.", :schedule_yaml => "---\n:start_date: 2013-04-03 10:55:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.duesseldorf.ihk.de/", :full_day => false, :category_id => 2, :picture_id => 215)
