Event.create(:id => 305, :name => "CREATIVE.NETWORK", :description => "CREATIVE.NETWORK lädt kreative Unternehmer, Selbständige und Freiberufler aus Essen und ganz NRW ein, sich miteinander zu vernetzen, regionale Experten und neue Geschäftspartner kennenzulernen und über Geschäftsideen wie branchenspezifische Herausforderungen zu diskutieren. Parallel dazu beantworten Kooperationpartner sowie das Team von CREATIVE.NRW Fragen kreativer Start-ups wie etablierter Akteure der Kreativwirtschaft zu Services und anstehenden Projekten - und vermitteln wertvolle Kontakte und weiterführende Informationen. Dies geschieht teils im direkten Dialog, teils im Gruppenaustausch. Nicht zuletzt sollen relevante Themen identifiziert und ein kontinuierlicher Austausch organisiert werden.\r\n\r\nMitzubringen: Interesse an der Vernetzung mit anderen Kreativen, Fragen zum Kreativwirtschaftsstandort NRW und wenn vorhanden eigene Ideen.", :schedule_yaml => "---\n:start_date: 2013-04-17 14:28:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://creative.nrw.de/", :twitter => "CREATIVE_NRW", :full_day => false, :twitter_hashtag => "CREATIVE_NETWORK", :category_id => 2, :picture_id => 217)
Event.create(:id => 306, :name => "webcon2013", :description => "Camp. Conference. Summit.\r\n\r\nDie webcon2013 bringt Internet-Interessierte, Entwickler, Entscheider und Social Media-Experten für ein Wochenende zur Konferenz in Aachen zusammen.\r\n\r\nTeilnehmer erhalten eine Plattform für den Austausch von Know-How und Erfahrungen. Vorträge, Präsentationen, Workshops und Diskussionsrunden von und mit den Teilnehmern bestimmen das Tagesprogramm. Die Themen der einzelnen Sessions sprechen gleichermaßen Einsteiger und Fortgeschrittene an.\r\n\r\nDie Schwerpunkte liegen auf **E-Commerce, Social Media, Webkultur und Technik**.", :schedule_yaml => "---\n:start_date: 2013-04-19 10:05:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.webcon.de/", :twitter => "webcon_De", :full_day => false, :twitter_hashtag => "webcon2013", :category_id => 1, :venue_id => 235, :picture_id => 218)
