Event.create(:id => 309, :name => "Forum Netzpolitik der KölnSPD", :description => "\"Das Forum wurde 2009 von Valentina Kerst gegründet und setzt sich für eine zukunftsorientierte Netzpolitik innerhalb der SPD ein. Wir diskutieren die Chancen und Herausforderungen, die durch das Internet entstehen und gehen der Frage nach, wie sozialdemokratische Politik agieren und handeln muss, um das Internet gesellschaftlich und wirtschaftlich voranzutreiben. Das Forum steht allen netzpolitisch Interessierten offen.\" \r\n\r\nQuelle: http://forumnetzpolitik.de/", :schedule_yaml => "---\n:start_date: 2013-04-22 16:09:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://forumnetzpolitik.de/", :twitter => "f_netzpolitik", :full_day => false, :category_id => 7, :picture_id => 222)
