Event.create(:id => 313, :name => "Rheinland-Pitch", :description => "Mit dem Rheinland-Pitch will der STARTPLATZ ein neues Format für eine monatliche Pitch- und Networking-Veranstaltung der rheinischen Gründerszene zwischen Startups und Investoren etablieren. Dabei wird jungen Startups die Möglichkeit gegeben, vor einem ausgewählten Publikum ihre Idee und ihr Vorhaben zu pitchen. Durch die regelmäßigen Termine soll die Pitch-Kultur im Rheinland gefördert werden.", :schedule_yaml => "---\n:start_date: 2013-04-29 18:00:00.000000000 Z\n:duration: 10800\n:rrules:\n- :validations:\n    :day_of_week:\n      1:\n      - -1\n  :rule_type: IceCube::MonthlyRule\n  :interval: 1\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://rheinlandpitch.startplatz.de/", :twitter => "startplatz", :full_day => false, :twitter_hashtag => "rpitch", :category_id => 2, :venue_id => 147, :picture_id => 229)
Event.create(:id => 314, :name => "hochschulgründernetz cologne", :description => "Neben der Qualifizierung durch gründungsspezifische Seminare und Workshops steht das hgnc Gründungsinteressierten für alle Fragen rund um das Thema Selbstständigkeit zur Verfügung. In Einzelberatungen entwickelt der hgnc die Geschäftsidee, coachen bei der Erstellung des Businessplans, erörtern mögliche Finanzierungsoptionen für die Umsetzung des Geschäftsmodells.\r\n\r\nSämtliche Leistungen des hgnc sind für Studierende, Mitarbeiter und Wissenschaftler der Mitglieder des hgnc e.V. kostenlos.", :schedule_yaml => "---\n:start_date: 2013-04-30 10:21:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://www.hgnc.de/", :full_day => false, :category_id => 2, :picture_id => 230)
