Event.create(:id => 316, :name => "Aachener Entrepreneurship Team", :description => "AC.E ist die Initiative für gründungsinteressierte Studenten.\r\n \r\nAC.E steht für „Aachener Entrepreneurship Team“ und ist eine Studenteninitiative, die Projekte und Events rund um das Thema Gründung und Innovation organisiert.\r\nIn enger Kooperation mit dem WIN-Lehrstuhl erhalten die Mitglieder der Studenteninitiative AC.E e.V. exklusiven Zugang zu WIN-Veranstaltungen und zum Gründerzentrum, um die eigene Gründung nach vorne zu bringen.", :schedule_yaml => "---\n:start_date: 2013-05-03 08:22:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://aachenerentrepreneurshipteam.de/", :full_day => false, :category_id => 2, :picture_id => 232)
Event.create(:id => 317, :name => "3DayStartup", :description => "40 Teilnehmer. 3 Tage. 1 Ziel.\r\n \r\n3 Day Startup ermöglicht es den Teilnehmern innerhalb von 3 Tagen ein (oder mehrere) Unternehmen zu gründen!\r\n\r\nDie Idee von 3 Day Startup ist einfach: Das 3DS-OrgaTeam stellt für ein ganzes Wochenende alles zur Verfügung, was für eine Unternehmensgründung gebraucht wird: Arbeitsplätze, Konferenzräume, rechtliche Rahmenbedingungen, Mentoren, Investoren, Essen, Getränke, Kaffee, etc.\r\n\r\n40 ausgewählte Teilnehmer aus verschiedenen Fachrichtungen werden eingeladen innerhalb von 60 Stunden den vollständigen Prozess einer Unternehmensgründung zu durchleben. Es geht hier nicht um eine Simulation, hier wird wirklich gegründet!", :schedule_yaml => "---\n:start_date: 2013-05-03 08:27:00.000000000 Z\n:duration: 3600\n:rrules: []\n:exrules: []\n:rtimes: []\n:extimes: []\n", :url => "http://aachenerentrepreneurshipteam.de/cms/?q=node/7", :full_day => false, :category_id => 2, :picture_id => 233)
